DROP TABLE IF EXISTS `skills`;
CREATE TABLE `skills` (
  `skill_id` int(10) unsigned NOT NULL auto_increment,
  `skill_name` varchar(52) NOT NULL default '',
  `skill_parent` varchar(52) NOT NULL default '',
  `skill_graph_type` varchar(10) NOT NULL default '',
  `skill_god_only` tinyint(1) default NULL,
  `skill_is_title` tinyint(1) default NULL,
  `skill_is_profession` tinyint(1) default NULL,
  `skill_is_hidden` tinyint(1) default NULL,
  `skill_money_required` int(10) unsigned default NULL,
  `skill_points_required` int(10) unsigned default NULL,
  `skill_requirements_count` int(10) unsigned default NULL,
  `skill_requirements` varchar(201) NOT NULL default '',
  `skill_preclusions` varchar(50) NOT NULL default '',
  `skill_xp_type` varchar(40) NOT NULL default '',
  `skill_xp_cost` int(10) unsigned default NULL,
  `skill_xp_cap` int(10) unsigned default NULL,
  `skill_required_missions` varchar(1) NOT NULL default '',
  `skill_apprenticeships_required` int(10) unsigned default NULL,
  `skill_stats_required` varchar(1) NOT NULL default '',
  `skill_species_required` varchar(56) NOT NULL default '',
  `skill_jedi_state_required` varchar(16) NOT NULL default '',
  `skill_abilities` varchar(1) NOT NULL default '',
  `skill_commands` text,
  `skill_mods` text,
  `skill_schematics_granted` varchar(123) NOT NULL default '',
  `skill_schematics_revoked` varchar(1) NOT NULL default '',
  `skill_is_searchable` tinyint(1) default NULL,
  `skill_ender` int(10) unsigned default NULL,
  `skill_children` varchar(128) NOT NULL default '',
  PRIMARY KEY  (`skill_id`),
  UNIQUE KEY `skill_id` (`skill_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1069 DEFAULT CHARSET=latin1;

